import React from 'react';
import './Footer.scss'

class Footer extends React.Component {
    render(){
        return(
            <footer>
                <div>
                    <h2>Explore</h2>
                    <ul>
                        <li>Get Started</li>
                        <li>Help Guide</li>
                        <li>About</li>
                    </ul>
                </div>
                <p>Designed and Developed by www.lewharris.co.uk</p>
            </footer>
        )
    }
}

export default Footer;
